="RI 323  - SANCHES TRIPLONI - 230 MTPA
04- APLICAÇÃO DE PROTOCOLO DE COMPLETAÇÃO MECÂNICA CIVIL
Realizado caminhada em campo com equipe GPO , qualidade Ductor e Qualidade Sanches  para aplicação dos seguintes protocolo de completação mecânica civil da base da adutora referente a Infraestrutura das bases no trecho 3  e 4. 

Durante Caminhada foram levantadas as seguintes pendências:

- Verificar junto à engenharia solução técnica para evitar o deslocamento dos suportes metálicos nas bases e garantir a sua posição ao longo de toda a linha;

- Retirar restos de materiais utilizados nas obras civis no entorno das bases (limpeza geral) no trecho 4 da linha;

Verificar existência de suporte para tubulação em balanço no início do trecho subterrâneo (trecho 4 da linha);

- Apresentar relatório topográfico evidenciando a locação das bases do Trecho 4 da linha;

- Realizar escavação para instalação da linha subterrânea do Trecho 4;

- Realizar acabamento superficial na base 156 (trecho 3 da linha);

- Verificar junto à engenharia solução técnica para a base 144 do trecho 3 da linha (ausência de encaixe do suporte metálico com a tubulação);

- Realizar escavação para instalação da rede subterrânea no trecho 3 da linha;

- Realizar nivelamento e compactação da área entre as bases 129 a 139;

- Verificar junto à engenharia solução técnica para o talude localizado entre as bases 129 e 139 do trecho 3 da linha;

- Instalar meio fio na região entre as bases 129 e 139 do trecho 3 da linha (removidos durante as atividades de escavação);

- Realizar acabamento superficial na base 131 no trecho 3 da linha;
"

