="RI 302 - SANCHES TRIPOLONI - 230 MTPA
01 - TR 83/93 - APLICAÇÃO DE PROTOCOLO DE CONPLETAÇÃO MECÂNICA CIVIL
Realizado Caminhada para aplicação de protocolo de completação mecânica civil referente a pavimentação asfáltica berma e drenagem superficial da Berma e cabeceira TR83/93. Durante caminhada foram levantadas as seguintes pedências: 
1- Corrigir patologias (fissuras) no pavimento do acesso na alça da cabeceira dos TRs 83/93 (lados AB e CD);
2- Fazer recomposição do asfalto na alça da cabeceira dos TRs 83/93 (lado CD);
3- Instalar defensas metálicas nos acessos das bermas dos TRs 83/93 (lados AB e CD);
4- Instalar sinalização vertical nas bermas dos TRs 83/93.;
5- Realizar acabamento com CBUQ entre o meio fio e o pavimento nas bermas e cabeceiras dos TRs 83/93 (lados AB e CD);
6- Recompor meio fio na cabeceira dos TRs 83/93;
7- Instalar meio fio na região entre o acesso e a faixa de manutenção no caminho de rolamento na berma dos Trs 83/93 (lado AB e CD);
8- Realizar limpeza do acesso nas bermas e cabeceiras dos TRs 83/93 (lados AB e CD);
9- Executar pavimentação asfáltica na  região do pré tie in no lado AB da berma dos TRs 83/93;
10- Eliminar pontos de acúmulo de água no acesso da berma dos TRs 83/93 (lado AB);
11- Executar pavimentação asfáltica no trecho do acesso AB ( balizas 88 a 90);
"

="RI 302 - SANCHES TRIPOLONI - 230 MTPA
02 - ADME - APLICAÇÃO DE PROTOCOLO DE COMPLETAÇÃO MECÃNICA CIVIL 
Realizado Caminhada para aplicação de protocolo de completação mecânica civil referente a sistema de drenagem superficial e terraplenagem. Durante caminhada foram levantadas as seguintes pendências: 
1- Recuperar canaleta em concreto (canal tipo 1) lado Leste, sentido do P1 ao sul do sistema de drenagem do ADME;
2- Verificar e corrigir desplacamento das canaletas do ADME;
3- Desobstruir canaletas nas derivações de canaleta do ADME existente (conformar o talude para evitar erosões futuras);
4- Recompor canaleta na curva do sistema de drenagem do lado leste no sentido sul do ADME;
5- Recompor solo na região de entorno da DAD lado Sul do ADME;
6- Realizar limpeza e desobstrução da canaleta da terceira banqueta do lado sul do ADME;
7- Recompor solo no entorno da canaleta do lado oeste no sentido sul do ADME;
8- Recompor solo e canaleta do trecho do acesso do ADME (canal tipo 1) - lado oeste;
9- Recompor talude lateral e reconstruir as canaletas danificadas e realizar limpeza do acesso do ADME (canal tipo 1) - lado oeste;
10 - Reconstruir trecho do sistema de drenagem do canal tipo 1 do lado oeste do ADME (próximo ao acesso de chegada ao canal);
11- Realizar limpeza, reaterrar lateral das canaletas do lado do talude e do ADME (trecho do P1 até ao bueiro de passagem - lado oeste);
"

