="RI 290 - SANCHES TRIPOLONI - 230 MTPA
02 - APLICAÇÃO DE PROTOCOLO DE COMPLETAÇÃO MECANICA CIVIL 
Realizado caminhada  com a equipe GPO ,Qualidade CST e Qulaidade Ductor para aplicação dos protocolos de completação mecânica civil  referente  a INFRA-BASE-TR-87-T1, INFRA-BASE-TR-87-T2,INFRA-BASE-TR-87-T3,INFRA-BASE-TR-87-T4 e INFRA-BASE-TR-87-T5. 
Durante caminhada foram levantadas as seguintes pendências: 
1- Instalar proteção física dos chumbadores das bases do TR-87 no trecho 1 (entre a CT 211 e a base dos Guinchos 87/88/89);
2-Disponibilizar peças e arruelas dos chumbadores utilizados nas bases no Trecho 1 do TR-87 (entre a CT 211 e a base dos guinchos do 87/88/89);
3- Realizar limpeza, drenagem e acabamento interno dos nichos dos pilares P147, P148, P149, P150 do TR 87 no trecho 1 (entre a CT 211 e a base dos guinchos dos TRs 87/88/89);
4- Realizar acabamento superficial (remoção de bicheiras e recuperação de áreas com desgaste superficial) dos pilares P147, P148, P149, P150 do TR 87 no trecho 1 (entre a CT 211 e a base dos guinchos dos TRs 87/88/89);
5- Realizar limpeza, acabamento superficial e correção de armação exposta da Laje 1 do TR 87 (Trecho 1);
6- Executar as bases típicas do TR-87  no trecho 1, conforme projeto executivo (23 unidades faltantes);
7- Realizar acabamento superficial (remoção de bicheiras, acabamento interno dos ninchos e recuperação de áreas com desgaste superficial) dos pilares P13 a P42 no trecho 1 (entre a CT 211 e a base dos guinchos dos TRs 87/88/89);
8- Realizar limpeza e nivelamento da laje L2 (pontos de acúmulo de água) do TR 87 no trecho 1;
9- Apresentar relatório de continuidade e resistividade da malha de aterramento do TR 87;
10 - Realizar limpeza, acabamento superficial e nivelamento das lajes L3 a L8 no trecho 1 do TR 87;
11- Realizar acabamento superficial nas vigas do eixo 6 e 7 do TR 87 e nivelar com a laje;
12- Disponibilizar porcas e arruelas das vigas dos eixos 4 e 5 no trecho 1 do TR 87;
13- Realizar acabamento e vedação com sikaflex das juntas de dilatação das lajes do TR 87 no trecho 1 (L1 à L8);
14- Executar bases para instalação da tela de proteção do transportador no trecho 1 do TR 87;
15- Realizar nivelamento e compactação no entorno das lajes L1 à L8 do TR 87 (trecho 1);
16 - Corrigir ponto de armação exposta na base B15 no trecho 1 do TR 87  (cobrimento insuficiente da armação e transpasse sem amarração);
17- Realizar acabamento nas juntas entre as bases e as lajes em todo o trecho 1 do TR 87 (entre a CT 215 e a base do guincho dos TRs 87/88/89;
18- Realizar desforma e corte dos vergalhões de amarração das formas nos ninchos dos pilares P13 a P42 do trecho 1 do TR 87;
19- Executar as bases das escadas na Laje 7 do TR 87 no trecho 1;
20 - Realinhar chumbador no pilar P39 no trecho 1 do TR 87;
21- Nivelar a tampa da caixa de drenagem com o piso da laje L6 no trecho 1 do TR 87 (verificar solução técnica com a engenharia)
