=" RI 282 - SANCHES TRIPOLONI - 230 MTPA
01 - APLICAÇÃO DE PROTOCOLO COMPLETAÇÃO MECÂNICA CIVIL
Realizado caminhada para aplicação de protocolo de completação mecânica civil  de pavimentação do pouso de manutenção da RP-09 (região da berma dos TR's 81/91), Superestrutura do transportador TR-91 (lajes da cabeceira), Superestrutura para descanso da lança da RP-09 (lajes), Taludes do pouso de manutenção da RP-09 (região da berma dos TR's 81/91) e terraplenagem do pouso de manutenção da RP-09 (região da berma dos TR's 81/91).  Durante caminhada foram levantada as seguintes pendências: 
1-	Recompor talude do pouso de manutenção da RP 09;
2-	Recuperar pontos de fissura e trincas no talude do pouso de manutenção, bem como aplicar a segunda camada de concreto projetado;
3-	Realizar ancoragem e finalizar a crista na região do acesso do talude do pouso de manutenção da RP-09;
4-	Realizar ancoragem do talude com o sistema de drenagem (sarjeta) na região de acesso do pouso de manutenção da RP 09.
5-	Recuperar pavimentação asfáltica na área de acesso à berma do TR-91 na região do pouso de manutenção da RP-09;
6-	Realizar acabamento de meio fio no entorno do pouso de manutenção na RP-09;
7-	Realizar vedação com sikaflex na junta entre o meio fio e o talude no entorno do pouso de manutenção da RP 09;
8-	Realizar limpeza e acabamento superficial no talude do pouso de manutenção da RP 09;
9-	Executar sistema de drenagem no entorno do pouso de manutenção da RP 09 (sarjetas);
10-	Verificar qual procedimento a ser utilizado na região entre o talude do pouso de manutenção e a base de descanso da lança (ênfase na drenagem e ancoragem do pé do talude);
11-	Verificar qual procedimento a ser utilizado na região entre o talude do pouso de manutenção e a base de descanso da lança (ênfase na drenagem e ancoragem do pé do talude);
12-	Corrigir desnivelamento do pavimento na área região do pouso de manutenção da RP 09;
13-	Realizar limpeza geral do pouso de manutenção da RP 09;
14-	Realizar corte de vergalhões no corpo do talude em todo entorno do pouso de manutenção da RP 09;
