="RI 278 - PIACENTINI - REVITALIAÇÃO DO CAMINHO DE ROLAMENTO - EP 313K-02
01 -  EP 313K  02 - ANALISE DE PLANO DE QUALIDADE DA OBRA
CONCLUIDO analise do PQO.EP2.01_R_B - Data Book referente ao contrato nº 5500094497 de revitalização do caminho de rolamento da EP 313K-02,  tem com objetivo planejar desenvolvimento das atividades relativas ao sistema de gestão da qualidade da obra, tendo como finalidade assegurar o atendimento aos projetos, requisitos contratuais legais, normas regulamentadoras e técnicas aplicáveis  á obra para garantir o atendimento as necessidades do cliente e as características especificas tendo como referência os requisitos da norma NBR ISO 9001:15, requisitos técnicos - RT 3130KP-G-500009_R_1 ,  procedimento PR-E-271- requisito mínimo para PQO para fornecimento de equipamentos e serviços e procedimento GU-G-601 - requisitos da qualidade.

Esse plano foi analisado  conforme os critérios de aceitação  da RT 3130KP-G-500009_R_1 , PR-E-271_R5 e GU-G-601 e aprovado com com os seguintes comentários:

- Inserir MATRIZ de comunicação estabelecendo as formas de comunicação e interface, RECURSOS –, lista com a qualificação das pessoas que irão executar as atividades críticas para a garantia da qualidade do serviço ou equipamento, layout – Infraestrutura e ambiente para operacionalização do SGQ.  Atender conforme RT-3130KP-G-500009_R1- Ítem 23.6 e PR-E-271_R5 - Ítem 6.1.1

-  Incluir no organograma da qualidade inspetor de qualidade (eletromecânicos) para o contrato;

-  Inserir item plano manutenção de equipamento;  

- Inserir processo de montagem mecânica (solda, ensaios, torque, tubulação e etc..), para a garantia e controle da qualidade em atendimento ao escopo do contrato;

- Apresentar Plano de inspeção e teste (PIT) atendendo todo escopo do contrato e aprovado pela fiscalização Vale QA/QC. A contratada deverá apresentar plano de inspeção e testes (pit), conforme padrão Vale - PE-Q-600;

-  Os procedimentos e registro informados no anexo deve estar aprovado pela fiscalização Vale QA/QC .

Observação: Plano da Qualidade da CONTRATADA deverá ser estruturado de modo a fornecer uma descrição geral e efetiva do sistema da qualidade a serem aplicados ao objeto do contrato. 

STATUS /ANALISE: APROVADO COM COMENTÁRIOS – Revisar o PQO e atender aos comentários. Em anexo check list de analise de aprovação do plano de qualidade da obra

"

