="RI 268 - SANCHES TRIPOLONI - 230 MTPA
01 -  APLICAÇÃO DE PROTOCOLO COMPLETAÇÃO MECÂNICA  CIVIL
Realizado  caminhada para aplicação de protocolo  de completação mecânica civil em infraestrutura na  rede de dutos na TR83/93. no momento da inspeção foram levantadas as seguintes pendências:
- Realizar drenagem e limpeza das caixas elétricas da rede de dutos dos TR'S 83/93 – TIPO B (importante garantir que essa atividade seja executada antes do fechamento das caixas);
- Realizar acabamento superficial no topo da borda da caixa CPQ-AP, bem como acabamentos na lateral e cobrimento de armação exposta no canto da caixa – TIPO B;
- Disponibilizar cabos de aterramento nas caixas elétricas (ênfase nas caixas CP1-AP, CP1-AO, CP1-AN, CP1-AM - ausência de cabos e/ou comprimento insuficiente) – TIPO A;
- Realizar interligações na malha de aterramento (conexões internas entre as caixas e com o transportador) – TIPO A;
- Recuperar ou substituir tampa das caixas elétricas CP1-AJ (armação exposta) – TIPO B;
Recuperar ou substituir tampa das caixas elétricas CP1-AH e CP1-AG (armação exposta e desgaste lateral) – TIPO B;
- Realizar acabamento interno na caixa CP1-AE e CP1-AF no entorno dos tubos kanaflex em ambas as faces (preencher com concreto e eliminar pontos de exposição da armação) – TIPO A;
- Executar envelopamento elétrico entre as caixas CP1-F/CP1-AE/CP1-AD – TIPO A
- Instalar escadas de acesso nas caixas CP1-A0, CP1-AL, CP1-AJ,CP1-AK,CP1-AL, CP1-AG, conforme projeto executivo (Caixas Tipo 1) – TIPO B (importante executar a atividade antes do fechamento das caixas);
- Apresentar relatório de continuidade e resistividade da malha de aterramento da rede de dutos dos TRs 83/93 – TIPO A
- Nivelar tampa da caixa CP1-AM com a cota do pavimento (verificado em campo possibilidade da caixa ficar acima do nível do pavimento após fechamento) – TIPO B
- Recuperar escada de acesso da caixa CP1-AD e realizar acabamentos internos no entorno dos tubos kanaflex – TIPO B (importante executar a atividade antes do fechamento das caixas);
- Recuperar pavimentação asfáltica nos trechos de envelopamento elétrico da rede de dutos dos TRs 83/93 localizadas na berma existente – TIPO B
- Fixar escada metálica da caixa CP1-AB da rede de dutos dos TRs 83/93 (trecho da berma existente) – TIPO B;
- Sinalizar as tampas das caixas elétricas da rede de dutos dos TRs 83/93 – TIPO B;
- Realizar vedação dos furos dos tirantes (região interna das caixas elétricas), bem como realizar corte do excedente (nivelar com a face da caixa) – TIPO B (Realizar antes do fechamento das caixas);
- Recompor solo e realizar compactação na região de reaterro do encaminhamento elétrico (envelopamento) entre as caixas da rede de dutos – TIPO B;"

